Digital Widescreen Test Transmission (BBC)

Arts Documentary hosted by Philip Read, published by BBC in 1998 - English narration


Information
------------------------------

Originally created in the late 1990s to show off the glory of standard definition widescreen TV, and features scenes from a Cornish summer's day.
Produced for the BBC by Qureshi and Associates.

